public class ComplexNumber\n{\n    public int A { get; }\n    public int B { get; }\n\n    public ComplexNumber(int a, int b)\n    {\n        A = a;\n        B = b;\n    }\n\n    public override int GetHashCode()\n    {\n        unchecked // Overflow is fine and expected\n        {\n            int hash = 17;\n            hash = hash * 23 + A.GetHashCode();\n            hash = hash * 23 + B.GetHashCode();\n            return hash;\n        }\n    }\n}